import React from "react";
import VideoItem from "./VideoItem";

import "./VideoItem.scss";

const VideoList = ({ videos, date }) => {
  let videosdate = [];

  const videoupdate = videos.map(video => {
    videosdate.push(video.snippet.publishedAt);
  });
  console.log(videosdate);
  const renderedList = videos.map(video => {
    return (
      <div className="items">
        <VideoItem key={video.id.videoId} video={video} date={date} />
      </div>
    );
  });
  return <div>{renderedList}</div>;
};

export default VideoList;
